description:
David Lamont - i branschen kallad &amp;#039;The King of Fright&amp;#039; - ar en stenrik bokagent som flyttar in i en flott vaning med alla bekvamligheter. Han far dock mer pa koptet an annonsen utlovade! En psykopat borjar snart skicka bilder pa makabra mord som tycks ha intraffat i hans nya hem, och snart foljs dessa upp av videoinspelningar pa David sjalv. Mannen som gjort karriar pa att skramma folk fran vettet ar nu sjalv offret i ett spel med dodlig utgang. En mycket intensiv thriller i glassiga miljoer fran producenterna bakom &quot;The Bourne Identity&quot; och &quot;X-Men..



